" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Transverse relaxation in MRI",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 338px; height: 204px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Evolution of transverse magnetization following a 90&deg; radiofrequency excitation. There is maximal alignment of magnetization vectors at time t=0 immediately after excitation. Vectors have lost phase coherence at time t=T",
"    <sub>",
"     2",
"    </sub>",
"    . At time t&gt;&gt;T",
"    <sub>",
"     2",
